"requiresUpgrade\";b:1;s:11:\"description\";s:147:\"<p>Optimize your site for Google\'s E-E-A-T ranking factor by proving your writer\'s expertise through author schema markup and new UI elements.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:33:\"https://aioseo.com/features/eeat/\";s:12:\"learnMoreUrl\";s:33:\"https://aioseo.com/features/eeat/\";s:9:\"manageUrl\";s:49:\"https://route#aioseo-search-appearance:author-seo\";s:8:\"features\";a:0:{}}}', '2025-10-29 03:09:37', '2025-10-27 01:39:37', '2025-10-28 03:09:37'),
