(1, '68e67255efadd', NULL, 'Have you connected your site to Google Search Console?', 'AIOSEO can now verify whether your site is correctly verified with Google Search Console and that your sitemaps have been submitted correctly. Connect with Google Search Console now to ensure your content is being added to Google as soon as possible for increased rankings.', 'warning', '[\"all\"]', NULL, 'search-console-site-not-connected', '2025-10-08 14:16:53', NULL, 'Connect to Google Search Console', 'https://route#aioseo-settings&aioseo-scroll=google-search-console-settings&aioseo-highlight=google-search-console-settings:webmaster-tools?activetool=googleSearchConsole', NULL, NULL, 0, 0, '2025-10-08 14:16:53', '2025-10-08 14:16:53'),
(2, '68fb221a40687', NULL, 'Email Reports', 'Stay ahead in SEO with our new email digest! Get the latest tips, trends, and tools delivered right to your inbox, helping you optimize smarter and faster. Enable it today and never miss an update that can take your rankings to the next level.', 'info', '[\"all\"]', NULL, 'email-reports-enable-reminder', '2025-10-24 06:52:10', NULL, 'Enable Email Reports', 'https://route#aioseo-settings&aioseo-scroll=aioseo-email-summary-row&aioseo-highlight=aioseo-email-summary-row:advanced', 'All Good, I\'m already getting it', 'http://action#notification/email-reports-enable', 0, 0, '2025-10-24 06:52:10', '2025-10-24 06:52:10'),
(3, '68fb221ba616e', NULL, ' 4.8.8 is Here  Unleash the Power of AI on Your Website!', '<img src=\"data:image/webp;base64,\" alt=\"\" class=\"wp-image-1311\" style=\"object-fit:cover\"/>\n\n<p>Ready to create content, images, and boost your visibility faster than ever? With AIOSEO 4.8.8, you get cutting-edge AI features right inside WordPress:</p>\n\n<p> Instantly generate blog posts, product copy, FAQs, and more with our new AI Assistant.</p>\n\n<p> Create stunning, one-of-a-kind images with the Image Generator  no designer needed.</p>\n\n<p> Take charge of how AI engines see your site using the new LLMS.txt Generator.</p>\n\n<p>Update to AIOSEO 4.8.8 now and supercharge your site with the future of SEO  powered by AI. </p>', 'success', '[\"4-x\",\"lite\"]', 1310, NULL, '2025-10-22 16:06:34', NULL, 'Learn More', 'https://aioseo.com/aioseo-4-8-8-release/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=4.8.8-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=4.8.8-v4-x-lite', 0, 0, '2025-10-24 06:52:11', '2025-10-27 01:39:36'),
(4, '68fb221ba9c78', NULL, ' Fall Sale: Up to 60% Off AIOSEO Plans + Upgrades', '<img src=\"data:image/webp;base64,\" alt=\"\" class=\"wp-image-1317\"/>\n\n<p>Fall is here, and so is your chance to rake in the savings. </p>\n\n<p>Were celebrating the season with <strong>up to 60% off t</strong>he best WordPress SEO plugin. Whether youre starting fresh or ready to upgrade, nows the perfect time.</p>\n\n<p>Think falling leaves, rising traffic, and incredible savings.&nbsp;</p>\n\n<p>But hurry, this sale is only here for a limited time. </p>', 'success', '[\"4-x\",\"lite\"]', 1316, NULL, '2025-10-24 00:00:00', '2025-10-31 00:00:00', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=fall-sale-2025-v4-x-lite', NULL, NULL, 0, 0, '2025-10-24 06:52:11', '2025-10-27 01:39:36'),
