(556, 128, 'description', '<strong>Ban OTR Tianli 35/65R33 TU600</strong> adalah solusi ban alat berat premium yang dirancang khusus untuk memenuhi tuntutan terberat di industri pertambangan (mining) dan konstruksi. Dengan reputasi global untuk ketahanan dan performa, ban Tianli ini menjamin produktivitas dan keamanan di medan paling ekstrem sekalipun.\r\n<h2>Keunggulan Utama Ban OTR Tianli 35/65R33 TU600</h2>\r\nModel TU600 dari Tianli bukan sekadar ban biasa. Ban ini dirancang dengan teknologi canggih untuk memberikan performa maksimal. Berikut adalah beberapa keunggulan utamanya:\r\n<ul>\r\n 	<li><strong>Daya Tahan Ekstrem:</strong> Dibuat dengan kompon karet khusus yang tahan terhadap sobekan, tusukan, dan panas berlebih, sangat ideal untuk medan tambang yang abrasif.</li>\r\n 	<li><strong>Traksi Superior:</strong> Pola tapak (tread pattern) yang agresif memberikan cengkeraman maksimal di berbagai permukaan, baik itu medan berlumpur, berbatu, atau tidak rata.</li>\r\n 	<li><strong>Kapasitas Beban Berat:</strong> Sesuai namanya, ban \"Off-The-Road\" (OTR) ini memiliki konstruksi radial yang kuat untuk menahan beban alat berat seperti dump truck dan loader.</li>\r\n 	<li><strong>Aplikasi Serbaguna:</strong> Selain untuk Mining &amp; Construction Tires, ban ini juga andal untuk aplikasi Agribusiness (pertanian skala besar) dan Forestry (kehutanan).</li>\r\n</ul>\r\n<h2>Spesifikasi Teknis Lengkap</h2>\r\n<ul>\r\n 	<li><strong>Merek:</strong> TIANLI</li>\r\n 	<li><strong>Model:</strong> TU600</li>\r\n 	<li><strong>Ukuran:</strong> 35/65R33</li>\r\n 	<li><strong>Kategori:</strong> OTR (Off-The-Road)</li>\r\n 	<li><strong>Fungsi:</strong> Mining, Construction, Agribusiness, Forestry</li>\r\n</ul>\r\n<h2>Mengapa Memilih PT. Abuhasdha &amp; Co.?</h2>\r\nSebagai distributor tepercaya, kami tidak hanya menjual <strong>ban ukuran 35/65R33</strong>, tetapi kami juga menyediakan solusi lengkap untuk kebutuhan armada Anda.\r\n\r\nKami berkomitmen pada kualitas dan layanan purnajual. <a href=\"/layanan/\">Hubungi tim profesional kami</a> untuk konsultasi gratis mengenai kebutuhan ban alat berat Anda.\r\n\r\nUntuk informasi lebih lanjut mengenai standar global produk ini, Anda dapat mengunjungi <a href=\"https://www.tianli-tyre.com/\" target=\"_blank\" rel=\"noopener noreferrer\">situs resmi Tianli Tyre</a>.'),
