(79, 1, '2025-10-26 06:25:10', '2025-10-26 06:25:10', '{\n    \"abuhasdha::about_description\": {\n        \"value\": \"PT. Abuhasdha didirikan pada tahun 1980 oleh Mr. Halim Soeganha, dan sejak itu menjadi salah satu penyedia ban OTR, truk, dan industri terkemuka di Indonesia. Dengan pengalaman lebih dari empat dekade, kami tidak hanya menawarkan produk berkualitas, tetapi juga menjadi mitra strategis bagi berbagai sektor industri.\\n\\nKami adalah distributor resmi Tianli Tyres (TUTRIC, China), produsen ban kelas dunia dengan lebih dari 300 ukuran, diekspor ke lebih dari 70 negara, dan didukung oleh riset serta standar internasional (ISO, REACH).\\n\\nKami percaya bahwa ban bukan sekadar komponen kendaraan, melainkan faktor penting dalam mendukung produktivitas, keamanan, dan keberlanjutan bisnis Anda.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-10-26 06:25:10\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', '76643545-9c62-400e-b7f0-23006391f502', '', '', '2025-10-26 06:25:10', '2025-10-26 06:25:10', '', 0, 'http://localhost:8888/abuhasdha/2025/10/26/76643545-9c62-400e-b7f0-23006391f502/', 0, 'customize_changeset', '', 0),
