(241, 1, '2025-11-13 14:52:49', '2025-11-13 14:52:49', '{\n    \"abuhasdha::about_description\": {\n        \"value\": \"PT. Abuhasdha didirikan pada tahun 1980 sebagai perusahaan yang berkecimpung di dalam penyediaan ban off the road, truck and bus, dan industrial. Dengan pengalaman sebagai penyedia produk ban, PT Abuhasdha menawarkan produk berkualitas dan menjadi mitra strategis customer kami.\\n\\nPT. Abuhasdha adalah distributor resmi wilayah Indonesia untuk ban merek Tianli yang diproduksi oleh Zhongce Rubber Co,Ltd. Kami berharap dan berkeyakinan untuk ban yang kami tawarkan dapat mendukung produktivitas dan keamanan bisnis Anda.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-11-13 14:52:49\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', '9e952817-4856-4282-9a80-798487a98963', '', '', '2025-11-13 14:52:49', '2025-11-13 14:52:49', '', 0, 'http://localhost:8888/abuhasdha/2025/11/13/9e952817-4856-4282-9a80-798487a98963/', 0, 'customize_changeset', '', 0),
